Male. Abdomen swollen, internal sacs all elongate, each sack extending length of two segments; on segment V lateral filament length slightly less than length of segment (
Fig. 83
). Genitalia (
Figs 59–60
): Segment IX subquadrate, tergites IX and X partly fused; gonopods each with coxopodite almost equal width throughout length, narrow sharp process apicomesally, small conical dorsal lobe at base, harpago about length of coxopodite, elongate digitiform; phallic apparatus cylindrical, dilated apically, without endothecal spines; pair of elongate slender spines lateral to phallus, arising at base of apodemes connected to gonopods, converging apically.
